import Link from 'next/link'

function Header() {
  return (
    <header style={headerStyle}>

      <Link href='/'>
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href='/about'>
        <a style={linkStyle}>About</a>
      </Link>

    </header>
  )
}

const linkStyle = {
  textDecoration: 'none',
  color: '#fff',
  marginRight: '15px',
}

const headerStyle = {
  background: '#3367d6',
  textAlign: 'right',
  padding: '10px',
  color: '#fff'
}

export default Header
